import React, { useState } from "react";
import "./App.css";

function App() {
  const [available, setAvailable] = useState(0);

  const getLyrics = async (song, artist) => {
    const new_song = song.split(" ");
    const final_song = [];
    for (var i = 0; i < new_song.length - 1; ++i) {
      final_song.push(new_song[i]);
      final_song.push("%20");
    }

    final_song.push(new_song[new_song.length]);

    const req = await fetch(
      `http://api.musixmatch.com/ws/1.1/matcher.lyrics.get?q_track=${final_song}&q_artist=${artist}`
    );
  };

  const handleSubmit = (e) => {};

  return (
    <div className="App">
      <form action="">
        <input type="text" name="songName" placeholder="song name" />
        <input type="text" name="artistName" placeholder="artist name" />
        <button>Get lyrics</button>
      </form>
    </div>
  );
}

export default App;
